import React, { useState } from "react";
import { DefaultPlayer as Video } from 'react-html5video';
import introvid from "./v11.mp4";
import FsLightbox from "fslightbox-react";
import { FiPlay, FiZoomIn, FiFolderPlus, FiDisc } from "react-icons/fi";

const video_pp = () => {

    return (

        <Video autoPlay loop>
            <source src={introvid} type="video/web" />
        </Video>
    )

}


export default video_pp;
